import { Card, Container, Form } from "react-bootstrap";

const Auth = () => {
	return (
		<Container
			className='d-flex justify-content alig-items-center'
			style={{ height: window.innerHeight - 54 }}
		>
			<Card style={{ width: 600 }} className='p-5'>
				<Form></Form>
			</Card>
		</Container>
	);
};

export default Auth;
